    patients: generatePatient() * NUM_PATIENTS,
    assistants: generateEmployee() * NUM_ASSISTANTS,
  }
  const appointments = generateRandomAppointments(people)
  console.log(appointments, people);
  return { ...people, ...{ appointments } }
};

const App = () => (
  <Router>
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/calendar">Calendar view</Link>
          </li>
          <li>
            <Link to="/day">Day view</Link>
          </li>
          <li>
            <Link to="/changes">Change Calendar</Link>
          </li>
        </ul>
      </nav>

      <main>
        <Switch>
          <Route path="/calendar">
            <Calendar appointments={appointments} />
          </Route>
          <Route path="/day">
            <Day appointments={appointments.filter(app => app.day === 1)} />
          </Route>
          <Route path="/changes">
            <Changes appointments={appointments} />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </main>
    </div>
  </Router>
);
export default App;
